description:
“The controlling power of appetite will prove the ruin of thousands, when, if they had conquered on this point, they would have had moral power to gain the victory over every other temptation of Satan. But those who are slaves to appetite will fail in perfecting Christian character.”  {Mar 62.5} 
“Our message is a life-and-death message, and we must let it appear as it is, the great power of God...The perils of the last days are upon us, and in our work we are to warn the people of the danger they are in. Let not the solemn scenes which prophecy has revealed be left untouched. If our people were half awake, if they realized the nearness of the events portrayed in the Revelation, a reformation would be wrought in our churches, and many more would believe the message. We have no time to lose; God calls upon us to watch for souls as they that must give an account...But whatever phase of the subject is presented, uplift Jesus as the center of all hope, ‘the Root and the Offspring of David, and the bright and morning Star.' Revelation 22:16.”  {6T 61.4}
www.prophesyagain.org
